import React, { useEffect, useState } from "react";
import BarHighInternet from '../../components/charts/BarHighInternet'
import BarHighKeinInternet from '../../components/charts/BarHighKeinInternet'
import '../../styles/highlight.css'


export default function HighInternetNutzung() {
    const [data, setData] = useState([]);
    const [data2, setData2] = useState([]);
    const [number, setNumber] = useState("0"); 
    const [value, setValue] = useState("2009"); 
    useEffect(() => {
        fetch("https://webhooks.mongodb-stitch.com/api/client/v2.0/app/dataviztest-bbcvc/service/viz/incoming_webhook/RI")
          .then(response => response.ok && response.json())
          .then(datazugang => {
            setData(datazugang);
            
          })
          .catch(console.error);
      }, [number, value]); 
      useEffect(() => {
        fetch("https://webhooks.mongodb-stitch.com/api/client/v2.0/app/dataviztest-bbcvc/service/viz/incoming_webhook/HighKI")
          .then(response => response.ok && response.json())
          .then(datazugang => {
            setData2(datazugang);
            
          })
          .catch(console.error);
      }, []); 

      return (
        <div className="highlightWrap">
          <div className="buttonWrap">{value}
                    <button onClick={() => setNumber("0") } className="buttonIn"  type="submit" value={() => setValue("2009")}>2009</button>
                    <button onClick={() => setNumber("1") } className="buttonIn"  type="submit" value={() => setValue("2014")}>2014</button>
                    <button onClick={() => setNumber("2") } className="buttonIn"  type="submit" value={() => setValue("2019")}>2019</button>
          </div>
            <BarHighInternet  data={data} number={number}></BarHighInternet>
            <div className="highlightWrap2">
                <h4>Gr√ºnde, warum kein Internetzugang besteht</h4>
                <BarHighKeinInternet data={data2}></BarHighKeinInternet>
            </div>
        </div>
        
        
        
        );
}
